        .data-table tbody tr:hover {background-color:#F5F8FF;transition:background-color 0.2s ease}

        .action-button:hover {transform:translateY(-2px);box-shadow:var(--box-shadow-hover)}

        .custom-scrollbar::-webkit-scrollbar-track {background:#f1f1f1;border-radius:4px}

        .custom-scrollbar::-webkit-scrollbar-thumb:hover {background:var(--secondary-color)}

            100% {transform:rotate(360deg)}}

        @keyframes fadeIn {from {opacity:0;transform:translateY(10px)}
            to {opacity:1;transform:translateY(0)}}
